DROP TABLE IF EXISTS `t_dealers`;
CREATE TABLE IF NOT EXISTS `t_dealers` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `dealerscode` double DEFAULT NULL,
  `fullname` varchar(255) DEFAULT NULL,
  `nickname` varchar(255) DEFAULT NULL,
  `height` varchar(255) DEFAULT NULL,
  `vitalstats` varchar(255) DEFAULT NULL,
  `hobbies` varchar(255) DEFAULT NULL,
  `birthday` date DEFAULT NULL,
  `followers` int(11) DEFAULT '0',
  `imageclassic` varchar(255) DEFAULT NULL,
  `imagegrand` varchar(255) DEFAULT NULL,
  `imageprestige` varchar(255) DEFAULT NULL,
  `imagemanbetx` varchar(255) DEFAULT NULL,
  `imagestreamer` varchar(255) DEFAULT 'https://www.orientalgame.com/wp-content/uploads/2018/08/og-live.jpg',
  `languages` varchar(255) DEFAULT 'en',
  `tableLocation` varchar(255) DEFAULT 'Lobby',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`),
  UNIQUE KEY `dealerscode` (`dealerscode`),
  UNIQUE KEY `fullname` (`fullname`)
) ENGINE=InnoDB AUTO_INCREMENT=244 DEFAULT CHARSET=utf8;


